// --- AUTH SYSTEM ---
function checkAuth() {
    const session = sessionStorage.getItem('tactical_session');
    const nav = document.getElementById('navAuth');
    if (!nav) return;

    if (session) {
        const user = JSON.parse(session);
        nav.innerHTML = `
            <li class="nav-item"><a class="nav-link" href="index.html">HOME</a></li>
            <li class="nav-item"><a class="nav-link" href="Gallery.html">ARMORY</a></li>
            <li class="nav-item dropdown">
                <a class="nav-link dropdown-toggle text-gold fw-bold" href="#" role="button" data-bs-toggle="dropdown">
                    <i class="fas fa-user-circle me-1"></i> ${user.name || user.username}
                </a>
                <ul class="dropdown-menu dropdown-menu-dark border-secondary">
                    <li><a class="dropdown-item" href="profile.html">PROFILE</a></li>
                    <li><hr class="dropdown-divider border-secondary"></li>
                    <li><a class="dropdown-item text-danger" href="#" onclick="logout()">LOGOUT</a></li>
                </ul>
            </li>
        `;
    } else {
        nav.innerHTML = `
            <li class="nav-item"><a class="nav-link" href="index.html">HOME</a></li>
            <li class="nav-item"><a class="nav-link" href="Gallery.html">ARMORY</a></li>
            <li class="nav-item ms-2"><a href="login.html" class="btn btn-outline-warning btn-sm fw-bold px-3">LOGIN</a></li>
            <li class="nav-item"><a href="register.html" class="btn btn-gold btn-sm fw-bold px-3">REGISTER</a></li>
        `;
    }
}

function logout() {
    sessionStorage.removeItem('tactical_session');
    window.location.reload();
}